import React, {Component} from 'react'

class PatientList extends Component
{
    constructor(props)
    {
        super(props);
        this.state = {
            error: null,
            items : []
        }
    }

    componentDidMount()
    {
        fetch("http://localhost:3002/Patients/",{ method:'Get', credentials:'include'})
            .then(res => res.json())
            .then(
                (result) => {
                    this.setState({
                        items: result
                    });
                },
                (error) => {
                    this.setState({
                        error : error
                    });
                }
            )
    }

    render()
    {
        return (
            <div >
            <select 
                        style={{width:"150px"}}
                        size="10" 
                        onChange={this.props.selectCarriers} >

                {items.map(item => (
                    <option key={item._id} value={item._Id}>
                        {item.firstName} 
                    </option>
                ))}
                </select>
            </div>
        );
    }

}

export default PatientList;
